package com.Two;

public class switchcase3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int x = 2;
switch(x) {
default :
	System.out.println("default");
case 1:
	System.out.println("1");
	break;
case 2:
	System.out.println("2");
	break;
case 3:
	System.out.println("3");
	break;
	

}
	}

}
